import { FLUSH_COCKPIT_DATA,LOADER } from '../actions/types'

const initialState = {
    isAuthenticated: false,
    user: {},
    cockpitData: {
        data: [],
        loader:false
    },
  };

export default function(state = initialState, action) {
    switch(action.type){
        case 'GET_SKU_COCKPIT':
            console.log('asdfsadgufkas', action.payload);
            // return action.payload
            return {
                ...state,
                cockpitData: action.payload
            }
        case LOADER:
            return {
                ...state,
                loader: action.payload
            }
        case FLUSH_COCKPIT_DATA:
            return {
                ...state,
                cockpitData: {
                    data: []
                },
            };
        default:
            return state
    }
}
